`;

export const TitleName = styled.div`
    font-family: 'Azonix Regular';
    font-style: normal;
    font-weight: normal;
    src: local('Azonix Regular'), url('../Azonix.woff') format('woff');

    @font-face {
    font-family: 'Azonix Regular';
